import React from 'react';
import s from './Header.module.css';

const Header = () => {
    return (
        <header className={s.header}>
            <img src='https://previews.123rf.com/images/annaleni/annaleni1706/annaleni170600077/79821477-archivo-icono-del-c%C3%ADrculo-del-documento-vector-illustration-flat-style-item-with-long-shadow-.jpg'/>
        </header>
    )
}

export default Header;
